import React from 'react';

import Child from './child.jsx';
var Explain = React.createClass({
    render : function () {
        return (
            <div className="parent">
                <p>Parent</p>
                <div className="child-list">
                    <Child wait_one={1000} />
                    <Child wait_two={3000} />
                    <Child wait_three={5000} />
                </div>
            </div>
        )
    }
});

export default Explain;
